import React from 'react';


class SearchResults extends React.Component{
  constructor(props){
      super(props);
      this.state = {
          searchResults: []
      }
  }

    componentWillMount(){
        fetch('http://hn.algolia.com/api/v1/items/1', {method: 'GET'},)
        .then(res => res.json())
        .then(data => this.setState({searchResults: data}));
    }
    render(){    
        let postResults = this.state.searchResults;   
         postResults = this.state.searchResults(searchResult => (
            <div key={searchResult.id}>
            <div>{searchResult.author}</div>
            <div>{searchResult.url}</div>
            <div>{searchResult.text}</div>
            <div>{searchResult.points}</div>
        </div>
        ));
        return <div><h1>List</h1>{postResults}</div>
    }
}

export default SearchResults;
